import 'package:json_annotation/json_annotation.dart';part 'employee_data_dto.g.dart';@JsonSerializable(ignoreUnannotated: false)class EmployeeDataDto {  @JsonKey(name: 'name')  final String? name;  @JsonKey(name: 'id')  final int? id;  @JsonKey(name: 'mobile')  final String? mobile;  @JsonKey(name: 'image')  final String? image;  EmployeeDataDto({this.name, this.image, this.mobile, this.id});  factory EmployeeDataDto.fromJson(Map<String, dynamic> json) => _$EmployeeDataDtoFromJson(json);  Map<String, dynamic> toJson() => _$EmployeeDataDtoToJson(this);}